const NumberList = (props) => {
  return (
    <div>
      <h1>Number List: </h1>
      <h3>
        {props.list.map((element, key) => {
          return <p key={key}>{element}</p>;
        })}
      </h3>
    </div>
  );
};

export default NumberList;
